class Solution(object):    def merge(self, nums1, m, nums2, n):        """        :type nums1: List[int]        :type m: int        :type nums2: List[int]        :type n: int        :rtype: void Do not return anything, modify nums1 in-place instead.        """        if n==0:            return        for i in range(m):            if nums1[i]>nums2[0]:                nums1[i],nums2[0]=nums2[0],nums1[i]                nums2.sort()        for i in range(m,m+n):            nums1[i]=nums2[i-m]        returnnums1 = [1, 2, 3, 0, 0, 0]m = 3nums2 = [2, 2, 6]n = 3s=Solution()n=100print(s.merge(nums1,m,nums2,n))